package com.github.pister.common.lang.codec;

import com.github.pister.common.lang.codec.Base64;
import junit.framework.TestCase;

import java.io.UnsupportedEncodingException;

/**
 * Created by songlihuang on 2020/5/11.
 */
public class Base64Test extends TestCase {

    public void testDecoder() throws UnsupportedEncodingException {
        String s = "";
        String j = "";
        System.out.println("base64 length:" + s.length());
        byte[] content = Base64.decodeBase64(s.getBytes("utf-8"));

        System.out.println("content length: "+ content.length);
        System.out.println("first 10 chars:");
        for (int i = 0; i < 10; i ++) {
            System.out.println(content[i]);
        }
        System.out.println("last 10 chars:");
        for (int i = content.length - 10; i < content.length; i ++) {
            System.out.println(content[i]);
        }
        //String md5 = DigestUtil.md5hex(content);
        //Assert.assertEquals("745EFBDDAB5615423155F594B1EE08FC", md5.toUpperCase());
    }

    public void testEncoder() throws UnsupportedEncodingException {
        String content = "\0x12\0x45";
        String s  = new String(Base64.encodeBase64(content.getBytes("utf-8")), "utf-8");
        System.out.println(s);
    }
}
